import { connect } from 'react-redux';
import Post from './Post';
class AllPost extends Component {


  total = (e) => {
    e.preventDefault();
    console.log('bonjout');
  }
  render() {
    return (
      <center className={"form"}>
        <table> 
          <thead>
            <tr className={"active"}>
              <th>Id</th>
              <th>Produits</th>
              <th>Prix</th>
              <th>Actions</th>
            </tr>
          </thead>
          {this.props.posts.map((post) => <Post key={post.id} post={post} />)}

          {/* {this.props.posts.map((post) => (
