              {post.editing ? <EditComponent post={post} key={post.id} /> : <Post post={post}
          key={post.id} />}
            </div>
          ))} */}
        </table>
        <div  onSubmit={this.total}>
          <button className={'total btn btn-info'}>TOTAL</button>
        </div>

        <div className={'ariary'}>TOTAL= Ar</div>
        </center>
    )}



}

const mapStateToProps = (state) => {
    return  {
        posts: state
    }
}
export default connect(mapStateToProps)(AllPost)
